import React from 'react';
import Test from './Test';
import logoImage from './logo.png';
import './App.js'
// Import Bootstrap CSS in case it's not globally imported
import 'bootstrap/dist/css/bootstrap.min.css';

const customStyle = {
  color : "red",
  textShadow : "2px 2px 5px yellow",
  fontFamily: "Times New Roman",
  textAlignLast: "center",  
  fontWeight: "bold",
  padding: "0px 40px",
}

const Navbar = () => (
  <nav className="navbar navbar-expand-lg navbar-light bg-light">
    <a className="navbar-brand" href="#">Home</a>
    <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
      <span className="navbar-toggler-icon"></span>
    </button>
    <div className="collapse navbar-collapse" id="navbarNav">
      <ul className="navbar-nav">
        <li className="nav-item active">
          <a className="nav-link" href="#">Features <span className="sr-only">(current)</span></a>
        </li>
        <li className="nav-item">
          <a className="nav-link" href="#">Pricing</a>
        </li>
        <li className="nav-item">
          <a className="nav-link" href="#">About</a>
        </li>
        <li className="nav-item">
          <a className="nav-link disabled" href="#" tabindex="-1" aria-disabled="true">Disabled</a>
        </li>
      </ul>
    </div>
  </nav>
);

const App = () => {
  return (
      <div className="container">
        <Navbar /> {/* Include Navbar component */}
        <div className="d-flex align-items-center">
          <img src={logoImage} alt="Company Logo" className="mr-3" width="100" height="100" />
          <h1 style={custom,Style}>Aptitude Test</h1>
        </div>

        <Test/>

      </div>
  );
};

export default App;
